const INITIAL_STATE = {
  data: [],
};

export default function AssetDevicesReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case "FETCH_ASSET_DEVICES":
      console.log({ 
        data: { sina:state.data, name: action.payload }});
      return {
        ...state.data,
        data: { name: action.payload },
      };
    default:
      return state;
  }
}
